import "./App.css";
import Navbar from "./components/Navbar";
import Footer from "./components/Navbar";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Navbar />} />
        <Route path="/s" element={<Footer />} />
      </Routes>
    </div>
  );
}

export default App;
